prompt Creating GYM_CLASS...
create table GYM_CLASS
(
  classid   INTEGER not null,
  classname VARCHAR2(50) not null,
  minage    INTEGER not null,
  maxage    INTEGER not null,
  duration  INTEGER not null
)
;
alter table GYM_CLASS
  add primary key (CLASSID);
alter table GYM_CLASS
  add constraint CHK_AGE_RANGE
  check (MinAge < MaxAge);

prompt Creating GYM_CLASS_MEDICAL_CONSTRAINS...
create table GYM_CLASS_MEDICAL_CONSTRAINS
(
  medical_constrains VARCHAR2(50) not null,
  classid            INTEGER not null
)
;
alter table GYM_CLASS_MEDICAL_CONSTRAINS
  add primary key (MEDICAL_CONSTRAINS, CLASSID);
alter table GYM_CLASS_MEDICAL_CONSTRAINS
  add foreign key (CLASSID)
  references GYM_CLASS (CLASSID);

prompt Creating PERSON...
create table PERSON
(
  personid  INTEGER not null,
  birthdate DATE not null,
  firstname VARCHAR2(30) not null,
  lastname  VARCHAR2(30) not null,
  city      VARCHAR2(30) default 'Unknown',
  street    VARCHAR2(50),
  housenum  INTEGER not null,
  email     VARCHAR2(40),
  gender    VARCHAR2(1)
)
;
alter table PERSON
  add primary key (PERSONID);

prompt Creating GYM_MEMBER...
create table GYM_MEMBER
(
  joindate  DATE not null,
  leavedate DATE,
  personid  INTEGER not null
)
;
alter table GYM_MEMBER
  add primary key (PERSONID);
alter table GYM_MEMBER
  add foreign key (PERSONID)
  references PERSON (PERSONID);

prompt Creating GYM_MEMBER_MEDICAL_CONSTRAINS...
create table GYM_MEMBER_MEDICAL_CONSTRAINS
(
  medicalconstrains VARCHAR2(50) not null,
  personid          INTEGER not null
)
;
alter table GYM_MEMBER_MEDICAL_CONSTRAINS
  add primary key (MEDICALCONSTRAINS, PERSONID);
alter table GYM_MEMBER_MEDICAL_CONSTRAINS
  add foreign key (PERSONID)
  references GYM_MEMBER (PERSONID) on delete cascade;

prompt Creating ITEM...
create table ITEM
(
  itemid     NUMBER(5) not null,
  itemname   VARCHAR2(40) not null,
  purpose    VARCHAR2(40) not null,
  weight     NUMBER(5,2),
  itemlength NUMBER(5,2)
)
;
alter table ITEM
  add primary key (ITEMID);

prompt Creating ROOM...
create table ROOM
(
  capacity INTEGER not null,
  roomnum  INTEGER not null,
  roomtype VARCHAR2(50) not null
)
;
alter table ROOM
  add primary key (ROOMNUM);

prompt Creating TRAINER...
create table TRAINER
(
  license   VARCHAR2(20),
  seniority FLOAT not null,
  personid  INTEGER not null
)
;
alter table TRAINER
  add primary key (PERSONID);
alter table TRAINER
  add foreign key (PERSONID)
  references PERSON (PERSONID);

prompt Creating LESSON...
create table LESSON
(
  lessondate DATE not null,
  lessonid   INTEGER not null,
  rating     FLOAT not null,
  classid    INTEGER not null,
  roomnum    INTEGER not null,
  personid   INTEGER not null
)
;
alter table LESSON
  add primary key (LESSONID, CLASSID);
alter table LESSON
  add foreign key (CLASSID)
  references GYM_CLASS (CLASSID);
alter table LESSON
  add foreign key (ROOMNUM)
  references ROOM (ROOMNUM);
alter table LESSON
  add foreign key (PERSONID)
  references TRAINER (PERSONID) on delete cascade;

prompt Creating PERSONAL_TRAINING...
create table PERSONAL_TRAINING
(
  traininghour       NUMBER(4,2) not null,
  trainingdate       DATE not null,
  traininglocation   VARCHAR2(30) not null,
  trainingcost       NUMBER(5,2) not null,
  classid            INTEGER not null,
  memberid           NUMBER(9) not null,
  trainerid          NUMBER(9) not null,
  personaltrainingid INTEGER not null
)
;
alter table PERSONAL_TRAINING
  add primary key (CLASSID, PERSONALTRAININGID);
alter table PERSONAL_TRAINING
  add foreign key (MEMBERID)
  references GYM_MEMBER (PERSONID) on delete cascade;
alter table PERSONAL_TRAINING
  add foreign key (TRAINERID)
  references TRAINER (PERSONID) on delete cascade;
alter table PERSONAL_TRAINING
  add foreign key (CLASSID)
  references GYM_CLASS (CLASSID) on delete cascade;
alter table PERSONAL_TRAINING
  add constraint DIFFERENT_IDS
  check (memberid<>trainerid);

